function iterateProcess(array, index, amount, delay) {
    return function (process, done) {
        var end = (index + amount < array.length) ? index + amount : array.length,
            selection = array.slice(index, end),
            first = array.slice(0, index),
            last = array.slice(end, array.length),
            completed = false;
        process(selection, function (selection) {
            console.log("Selection: " + selection);
            var modified = first.concat(selection.concat(last));
            if (index + amount < array.length) {
                if (!delay)
                    iterateProcess(modified, index + amount, amount)(process, done);
                else
                    setTimeout(function () {
                        iterateProcess(modified, index + amount, amount, delay)(process, done);
                    }, delay);
            } else {
                if (!completed) {
                    completed = true;
                    done(modified);
                }
            }
        });
    };
}

function compileCSV() {
    getAuthenticationCookie(function (cookie) {
        iterateProcess(ous, 0, 3, 500)(function (items, done) {
            iterateProcess(items, 0, 1, 500)(function (ou, complete) {
                var current = ou[0];
                getRow(current, cookie, function (line) {
                    complete([line]);
                });
            }, done)
        }, function (lines) {
            var csvLines = lines.map(function(line){
                return line.replace(/[-]/g, ",");
            })
            var csv = csvLines.join("\n");
            fs.writeFile("./export/data.csv",csv, function(err){
                if(err) throw err;
                console.flag("Finished");
            })
            
        });
    });
}

compileCSV();